import Button from '../components/Button';
import logo from '../to-do.webp';
import '../css/to-do_style.css'
function ToDo() {
  return (
    <div className="To-Do">
        <div className='head'>
            <img src={logo} className="App-logo" alt="logo" />
            <>
                <h4>Monika Gamage</h4> 
                <h6>@monicagamage</h6>
                <Button url = "/" sty>Log Out</Button>
            </>
        </div>
        <div className = 'to-do'>
        <h4>Tasks List</h4>
        <ul>
            <li>1</li>
            <li>2</li>
            <li>3</li>
        </ul>
        </div>
    </div>
  );
}

export default ToDo;
